import React from 'react';
import {
  Card,
  CardContent,
  CardHeader,
  Typography
} from '@mui/material';

function PokemonCard({ name, key, description }) {

  return (
    <Card>
      <CardHeader>
        <Typography> {name} </Typography>
      </CardHeader>
      <CardContent>
        {description}
      </CardContent>

    </Card>);
}

export default PokemonCard;
